menuItems = []

for item in value.menuItems:
	menuItems.append({
	  "target":  item.get('target'),
	  "items": [],
	  "navIcon": {
	    "path":"",
	    "color": ""
	  },
	  "label": {
	    "icon": {
	      "path":  item.get('icon')
	    },
	    "text": item.get('label')
	  },
	  "visible": True,
	  "enabled": True,
	  "showHeader": True,
	  "resetOnClick": False,
	  "style": {
	    "classes": "neumorphic" if item.get('target') == value.pagePath else ""
	  }
	})


return menuItems
